import {
	Box,
	Card,
	CardHeader,
	Heading,
	CardBody,
	Text,
} from "@chakra-ui/react";
import { useEffect, useState } from "react";

function CoursesPage() {
	let elements = [];

	const [backendData, setBackendData] = useState({
		names: [""],
		description: [""],
	});

	useEffect(() => {
		fetch("/api")
			.then((response) => response.json())
			.then((data) => {
				setBackendData(data);
			});
	}, []);

	function createCards() {
		for (let index = 0; backendData.names.length; index++) {
			const name = backendData.names[index];
			const desc = backendData.description[index];

			elements.push();
		}
	}
	createCards();

	return (
		<Box margin="10px">
			{elements.map((e) => {
				return e;
			})}
		</Box>
	);
}

export default CoursesPage;
